        "description": "Every day in January 2022 I generated a new output from an algorithm, generated a random wallet address, and sent the work to that address. On the final day, January 31st, all the previous Dead Ringers were placed in a 5 by 6 grid and minted to a generated address.\r\n\r\nIt was almost guaranteed none of the wallets that received Dead Ringers would ever be accessible given there are 16 to power of 40 available addresses. I hoped it would help observers appreciate the vastness of the address space and the underlying security it provides to the network used to distribute the work.\r\n\r\nThe Dead Ringers: Edition flips that notion on its head. Now an edition of January 31, 2022, colloquially known as the Dead Ringers grid, is available for every address if they want one. An edition size capped at 16 to the power of 40.",
